import logo from './logo.svg';
import './App.css';
import React, { useState} from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Login from './lo'

function App() {
  return (
    <Router>
      <Routes>
        <Route path = '/login' component = {<Login />} />
      </Routes>
    </Router>
  );
}

export default App;
